import React from "react";

const AIHelper = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        مساعد الذكاء الاصطناعي
      </h1>
      <p className="text-gray-600">صفحة المساعد الذكي قيد التطوير...</p>
    </div>
  );
};

export default AIHelper;
